export default function todoToShowReducer(state = null, action) {
      switch (action.type) {
          case 'GET_TODO':
            console.log(action.todoToShow)
            todoToEdit = {
              id: action.todoToEdit.id,
              title: action.todoToEdit.title,
              content: action.todoToEdit.content
            }
            return action.todoToShow
          default:
            return state
      }
    }
